import * as React from 'react';
import { useForm } from "react-hook-form";

interface BoxInserterProps{

}


function BoxInserter(props: BoxInserterProps) {
    const { register, handleSubmit } = useForm();
  const onSubmit = (data: any) => {
    alert(JSON.stringify(data));
  };

    return (
        <div className="box-green">
            <h4 className='title'>Box Inserter</h4>
            <form onSubmit={handleSubmit(onSubmit)}>
                <label className="label-inserter" htmlFor="R">R: </label>
                <input class type="number" {...register('R')}/>
                <label htmlFor="G">G: </label>
                <input type="number" {...register('G')}/>
                <label htmlFor="B">B: </label>
                <input type="number" {...register('B')}/>
                <button type="submit">Apply</button>
            </form>

        </div>
      );
}

export default BoxInserter;
